import './Tours.css'
import Tour from "./tour/Tour.js";
import React from "react";

function Tours (props){

    return (
        <>
            <h2>Tours list</h2>
            {
                props.arrayData.map((item, i) => {
                    return (
                        <Tour tour = {item}/>
                    )
                })   
            }    
        </>
    )
}

const dataArrayString = JSON.stringify(props);

// Save the stringified array in local storage
localStorage.setItem('myDataArray', dataArrayString);

  export default Tours;
